import React from "react";

import "./info.styles.css"


function Info(){
    return(
        <div className="info">

            <img src="/media/me.jpg" alt="" />
            <div className="cent">
            <h1>Dimitris Apostolopoulos</h1>
            <h3>Junior Frontend Developer</h3>
            <p>dim.apostolopoulos95@gmail.com</p>
            </div>

            <div className="buttons">

                <a href="mailto:dimisap1995@gmail.com"><button class='btn btn-light'><img src="/media/mail.jpg" className='mail-img' alt="" /> Email</button></a>
                <a href="https://www.linkedin.com/in/dimitris-apostolopoulos-9847a1172/" target='_blank'><button class='btn btn-outline-primary'><img src="/media/linkedin.jpg" alt="" /> LinkedIn</button></a>
            </div>
        </div>

    )
}


export default Info;
